import React, { Fragment } from 'react'
import Body1 from '../atom/typography/body1'
import ContainedButton from '../atom/button/ContainedButton'

export type SampleTemplateProps = {
    onIncrement: () => void,
    onDecrement: () => void,
    count: number
}

export default (props: SampleTemplateProps) => {
    return (
        <Fragment>
            <Body1>{props.count}</Body1>
            <ContainedButton onClick={props.onIncrement}>+</ContainedButton>
            <ContainedButton onClick={props.onDecrement}>-</ContainedButton>
        </Fragment>
    )
}
